import styled from 'styled-components'

export const Container = styled.header`
    display: flex;
    width: 100%;
    height: 4.5rem;
    background-color: whitesmoke;
    align-items: center;
    padding: 0 10rem;

    ul {
        list-style-type: none;
        margin: 0 auto;

        li {
            display: inline-block;
            margin: 0 2rem;

            a {
                color: #747474;
                text-decoration: none;
            }
        }
    }

    div
`;
